export default function Profile({ name, email, age, isAdmin = false }) {
  return (
    <div className="alert alert-success">
      <h3>
        Name: {name}
        {isAdmin && <span>(Admin)</span>}
      </h3>
      <p>Email: {email}</p>
      <p>Age: {age}</p>
    </div>
  );
}
